import './Main.css';
import Header from './components/header/Header';
import {Route, Link, Router} from 'react-router-dom'
import Blog from './pages/Blog';
import Cenik from './pages/Cenik';
import Kontakt from './pages/Kontakt';
import NaseSluzby from './pages/NaseSluzby';
import Reference from './pages/Reference';
import Realizace from './pages/Realizace';
import Vizualizace from './pages/Vizualizace';
import Home from './pages/Home';
function Main() {
  return (
    <div className="App">
      <Route exact to='/' component={Home} />
      <Route exact to='/blog' component={Blog} />
      <Route exact to='/cenik' component={Cenik} />
      <Route exact to='/kontakt' component={Kontakt} />
      <Route exact to='/naseSluzby' component={NaseSluzby} />
      <Route exact to='/reference' component={Reference} />
      <Route exact to='/realizace' component={Realizace} />
      <Route exact to='/vizualizace' component={Vizualizace} />
    </div>
  );
}

export default Main;
